import React, { useState, useEffect } from 'react';
import { supabase } from '../../supabaseClient';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
} from 'chart.js';
import 'chartjs-adapter-date-fns';
import AnxietyRiskChart from '../../components/charts/AnxietyRiskChart';
import { PM25Chart, CityComparisonChart } from '../../components/charts';

// Register Chart.js components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
);

const Dashboard = ({ city = 'Toronto' }) => {
    const [timeSeriesData, setTimeSeriesData] = useState([]);
    const [algorithms, setAlgorithms] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    const fetchTimeSeriesData = async () => {
        setLoading(true);
        try {
            // Get current date
            const endDate = new Date();
            const startDate = new Date();
            startDate.setDate(endDate.getDate() - 365);

            console.log('Fetching data for range:', {
                start: startDate.toISOString(),
                end: endDate.toISOString()
            });

            // Fetch weather data
            const { data: weatherData, error: weatherError } = await supabase
                .from('weather_data')
                .select('pm25, created_at')
                .eq('city', city)
                .gte('created_at', startDate.toISOString())
                .lte('created_at', endDate.toISOString())
                .order('created_at', { ascending: true });

            if (weatherError) throw weatherError;

            // Fetch algorithms
            const { data: algoData, error: algoError } = await supabase
                .from('risk_algorithms')
                .select('*')
                .order('period_days');

            if (algoError) throw algoError;

            // Process weather data
            const processedData = weatherData
                .filter(d => d.pm25 != null && d.created_at != null)
                .map(d => ({
                    x: new Date(d.created_at),
                    y: parseFloat(d.pm25)
                }));

            console.log('Processed data points:', processedData.length);
            setTimeSeriesData(processedData);
            setAlgorithms(algoData);

        } catch (err) {
            console.error('Error fetching data:', err);
            setError(err.message);
        } finally {
            setLoading(false);
        }
    };

    useEffect(() => {
        fetchTimeSeriesData();
    }, [city]);

    if (loading) return <div>Loading dashboard...</div>;
    if (error) return <div>Error: {error}</div>;
    if (!timeSeriesData.length) return <div>No data available</div>;

    return (
        <div className="dashboard">
            <div className="dashboard-content">
                <h1>Air Quality Dashboard - {city}</h1>

                <div className="content-wrapper">
                    <div className="chart-side">
                        <div className="chart-container">
                            <div className="chart">
                                <PM25Chart />
                            </div>
                            <div className="chart">
                                <CityComparisonChart />
                            </div>
                        </div>
                    </div>

                    <div className="data-side">
                        <div className="key-data-points">
                            <div className="key-data-title">Key Data Points</div>
                            <div className="key-data-point">
                                <span className="key-data-number">25</span>
                                <span className="key-data-label">Current PM2.5 Level (μg/m³)</span>
                            </div>
                            <div className="key-data-point">
                                <span className="key-data-number">15</span>
                                <span className="key-data-label">24h Average (μg/m³)</span>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
